  max-width: 1600px;
  margin: auto;
  grid-gap: 40px 80px;
  grid-template-columns: 1fr;

  ${mediaQuery.lessThan('medium')`
    grid-template-columns: 1fr;
    grid-gap: 20px 40px;

  `}
`;
